        $(""#ImageId"").html(procemessage).show();
        var url = ""/images/getimagesbytype/"" + _stateId;

        $.ajax({
            url: url,
            data: { id: _stateId },
            cache: false,
            type: ""POST"",
            success: function (data) {
                if (data.length > 0) {
                    var markup = ""<option value='0'>Wybierz obrazek</option>"";
                } else {
